import './App.css';
import Testimonio from './componentes/testimonio';

const testimonios = [
  {
    imagen: 'emma',
    nombre: 'emma',
    pais: 'pais',
    cargo: 'cargo',
    empresa: 'empresa',
    testimonio: 'testimonio'
  }
]

function App() {
  return (
    <div className="App">
      <h1>Here is what our alumni say about freeCodeCamp:</h1>
      <Testimonio />
    </div>
  );
}

export default App;
